  if (hasDST(checkExpiry)) {
    epochExpiryDST = epochExpiry.clone().add(1, "h");
    epochExpiry = epochExpiryDST.unix();
  } else {
    epochExpiry = epochExpiry.unix();
  }

  return epochExpiry;
};

