import { BigNumber } from "@ethersproject/bignumber";

import { getPrice } from "../utils/getPrice";
import { getOptionsNeeded } from "../utils/getOptionsNeeded";

const PRECISION = BigNumber.from(10).pow(18);

export const getAvailableLiquidity = async (
  spotPrice,
  option,
  skew,
  baseIv,
  slippage,
  liquidity
) => {
  const { price } = getPrice(option, baseIv, skew);
  const maxOptions = liquidity.mul(PRECISION).div(spotPrice);

  //console.log(spotPrice / 1e18);

  //console.log(liquidity / 1e18);

  //console.log(`max options at ${spotPrice / 1e18}: ${maxOptions / 1e18}`);

  const maxUnderlying = maxOptions.mul(PRECISION).div(price);

  let iterations = 0;
  while (iterations < 3) {
    const remainingOptions = await getOptionsNeeded(
      spotPrice,
      option,
      skew,
      baseIv
    );
    const remainingUnderlying = remainingOptions.mul(price).div(PRECISION);

    if (remainingOptions.eq(0) || remainingUnderlying.lt(maxUnderlying)) {
      const availableLiquidity = maxUnderlying.sub(remainingUnderlying);
      const slippageAdjustedLiquidity = availableLiquidity
        .mul(slippage)
        .div(PRECISION);
      return availableLiquidity.sub(slippageAdjustedLiquidity);
    }

    if (remainingUnderlying.gt(maxUnderlying)) {
      maxUnderlying = maxUnderlying.add(
        remainingUnderlying.sub(maxUnderlying).div(2)
      );
    }

    if (remainingUnderlying.lt(maxUnderlying)) {
      maxUnderlying = maxUnderlying.sub(
        maxUnderlying.sub(remainingUnderlying).div(2)
      );
    }

    iterations++;
  }

  throw new Error("No available liquidity found");
};

